import React from 'react';
import Navbar from './components/Navbar';
import InterpolPage from './components/InterpolPage'; 
import FbiPage from './components/FbiPage';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './components/HomePage';
import LoginComponent from './components/LoginComponent';
import RegisterComponent from './components/RegisterComponent';
import PrivateRoute from './routes/PrivateRoute';
import { AuthenticationProvider } from './contexts/AuthenticationContext';

const App = () => {
  return (
    <AuthenticationProvider>
      <Router>
        <>
          <Navbar />
          <div className="row mt-3">
            <div className="col" id="wanted-persons">
              <Routes>
                <PrivateRoute path="/fbi" element={<FbiPage />} />
                <PrivateRoute path="/interpol" element={<InterpolPage />} />
                <Route path="/login" element={<LoginComponent />} />
                <Route path="/register" element={<RegisterComponent />} />
                <Route path="/" element={<HomePage />} />
              </Routes>
            </div>
          </div>
        </>
      </Router>
    </AuthenticationProvider>
  );
};

export default App;
